import Card from "../UI/Card/Card";
import ShipDate from "./ShipDate";

function Ship(props){
    return <li>
        <Card>
            <ShipDate date = {props.date} />
            <div>
                <h2>{props.name}</h2>
            </div>
            <div>${props.price}</div>
        </Card>
    </li>
}
export default Ship;
